DELIMITER $$
--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `GetMarketingDashboardData` (IN `startDate` DATE, IN `endDate` DATE)   BEGIN
    SELECT 
        jc.source_name,
        COUNT(*) AS leads,
        SUM(CASE WHEN jc.status_name = 'Appointment Scheduled' THEN 1 ELSE 0 END) AS appointments,
        ROUND((SUM(CASE WHEN jc.status_name = 'Appointment Scheduled' THEN 1 ELSE 0 END) / COUNT(*)) * 100, 2) AS `porc_appointments`,
        SUM(CASE WHEN jc.status_name = 'Demo Completed' THEN 1 ELSE 0 END) AS demos,
        ROUND((SUM(CASE WHEN jc.status_name = 'Demo Completed' THEN 1 ELSE 0 END) / COUNT(*)) * 100, 2) AS `porc_demos`,
        IFNULL(sales, 0) AS sales,
        ROUND((IFNULL(sales, 0) / COUNT(*)) * 100, 2) AS `porc_sales`,
        FORMAT(SUM(CASE WHEN jc.cf_double_5 > 0 THEN jc.cf_double_5 ELSE 0 END), 2) AS revenue,
        FORMAT(IFNULL(mcs.total_amount, 0), 2) AS cost,
        FORMAT(IFNULL(mcs.total_amount, 0) / COUNT(*), 2) AS `cost_leads`,
        FORMAT(IFNULL(mcs.total_amount, 0) / IFNULL(NULLIF(sales, 0), 1), 2) AS `cost_sales`,
        ROUND(((SUM(CASE WHEN jc.cf_double_5 > 0 THEN jc.cf_double_5 ELSE 0 END) - IFNULL(mcs.total_amount, 0)) / IFNULL(mcs.total_amount, 1)) * 100, 2) AS `porc_roi`
    FROM 
        jobnimbus_contacts jc
        INNER JOIN marketing_channels mc ON jc.source_name = mc.source_name
        LEFT JOIN (
            SELECT 
                id_marketing_channels, 
                SUM(amount) AS total_amount
            FROM 
                marketing_channel_spend
            GROUP BY 
                id_marketing_channels
        ) mcs ON mc.id = mcs.id_marketing_channels
        LEFT JOIN (
            SELECT 
                source_name,
                SUM(CASE WHEN status_name = 'Sign PA Contract' THEN 1 ELSE 0 END) AS sales
            FROM 
                jobnimbus_contacts
            GROUP BY 
                source_name
        ) sales_data ON jc.source_name = sales_data.source_name
    WHERE 
        jc.source_name IS NOT NULL
    GROUP BY 
        jc.source_name
    ORDER BY 
        leads DESC;
END$$

